import * as L from 'leaflet';


export function icon(name){
    const ICON = L.icon({
        iconUrl: 'https://mappinghistorybucket.s3.us-east-2.amazonaws.com/MappingHistoryMarker/'+name+'&corner-radius=50,50,50,50',
        iconSize: [40, 40],
    })
    return ICON;
}

export function iconRandom(name){
    const ICON = L.icon({
        iconUrl: 'https://source.unsplash.com/50x50/?'+name,
        iconSize: [50, 50],
    })
    return ICON;
}


export const ICONRED = L.icon({
    iconUrl: "icon-red.png",
    iconSize: [40, 40],
})

export const ICONBLUE = L.icon({
    iconUrl: "icon.png",
    iconSize: [40, 40],
})


export var theRadius= 1000
